import React from 'react';
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button
} from 'reactstrap';

import { GridParent, GridChild } from '../Grid';

function SampleGrid() {
  return (
    <GridParent id="parent">
      <GridChild>test</GridChild>
    </GridParent>
  );
}
export default SampleGrid;
